import * as React from 'react';
import styled from 'styled-components';
import Box from '@mui/material/Box';
import Inputbox from '../../Sup Components/Input/Input'
import './Myaccount.css'





function Myaccount() {
  return (




    <Box
      style={{
        marginTop: '5px',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
       
        
      }}
    >
      <Box
        style={{
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
          maxWidth: '100%',
          overflow: 'auto',
        }}
      >


      
    <Box className="box1">
  
     <Box className="mainContainer">

<Box className="inputcontainer">
</Box>
<Box sx={{backgroundColor:"red", height: "100%",
    width: "50%"}}>
        <Box className="login" sx={{backgroundColor:"purple"}}>
<h2>Login</h2>
</Box>

<Inputbox/>







    </Box>
     </Box>
     </Box>
     
     </Box></Box>
     
  );

}


export default  Myaccount;
